INSERT INTO `settings_frontend` (`id`, `type`, `description`) VALUES ('12', 'homepage_note_description', 'St. Patricks Model School is a public secondary school in Umuahia and Aba, Abia State. It serves students in grades 912 in the southern part of Umuaia of the St. Patrick School School District, including the neighborhoods of Eastgate, Factoria, Newport Hills, Newport Shores, Somerset, The Summit, and Sunset. As of the 2014-2015 school year, the principal is Dion Yahoudy. The mascot is the Knight, and the school colors are scarlet and gold.                       ');
INSERT INTO `settings_frontend` (`id`, `type`, `description`) VALUES ('13', 'about_us', '<h2>About Saint Patrick\'s Model School</h2>St. Patricks model Schools started its operation on the 14th day of January 1991 with the establishment of St. Patricks Model Primary School at Umuokahia, ogbor Hill, Aba. The Ministry of Education granted approval to run primary one to five only. By the following year1992 after due inspection, we were allowed to add primary six thereby granting the school full operation as a standard primary school. Due to pressure from parents, the secondary School was established in 1994 first as a day school at Umuokahia and in 1996 a boarding school at Umuojima. The first WASSCE was held in the school in May 2000 after due inspection by Ministry of education in 1998 and WAEC officials in 1999. The result of WASSCE in the year 2000 was very impressive. Since then, we have turned out over fourteen (14) sets of students successfully especially in the Sciences and Mathematics.<span>Our science laboratories are very standard and well equipped. The school has a strong team of teachers numbering 120 university graduate teachers both in arts and sciences. In 2003, St. Patricks Model School established a branch at Umuahia on a temporary site at No. 4 Aba Road. In September 2006, the school moved to its permanent site at St. Patricks Crescent Road World Bank Housing Estate Umuahia. Here again we, run creche, primary, Nursery and Secondary sections. Both Umuahia and Aba arms of the school are approved for WASSCE and we have been doing well. We also expose the students to NECO exams and results have at all times been fantastic.</span>');
